import React from 'react';
import { Modal, Button } from 'react-bootstrap';
import { AiFillCheckCircle } from "react-icons/ai";


function PaymentSuccessCard() {
    return (
        <Modal 
        show={true}
        size="lg"
        backdrop="static"
        >
        <Modal.Body size="lg" className="p-5">
          <div className="d-flex flex-column align-items-center justify-content-center">
          <AiFillCheckCircle size={65} className="mb-5" />
          <p className="text-monospace font-weight-bold" style={{fontSize: 24}}>Thanks for your order!</p>
          <p className="mb-0">Your payment was Successful, and your order is complete</p>
          <p className="mb-5">A receipt will be sent to your inbox</p>
          <Button href="/" variant="dark">Head back to your order</Button>
          </div>
        </Modal.Body>
      </Modal>
    )
}

export default PaymentSuccessCard
